import '../../styles/landing-main.scss'

export default function MainPage() {
  const { t } = useTranslation();

  return (
    <div className="landing-main-page">
        <p className="landing-main-page__title">{t("landing.MainPage.title")}</p>
        <p className="landing-main-page__subtitle">{t("landing.MainPage.title")}</p>
        <button className="landing-main-page__button">Вибрати букет</button>
        <div className="landing-main-page__line"></div>
    </div>
  );
}
